import React, { useState } from 'react';
import getOneLink from '../API/getOneLink';


function Link() {
    const [ link, setLink ] = useState("");

    getOneLink()
            .then(link => {
                setLink(link);
            })

    return (
        <div>
            {link}
        </div>
    )
}

export default Link
